Dalam kejadian 6.37 petang itu, 29 penumpang komuter dan 93 penumpang ETS tidak mengalami kecederaan.

Ketua Pegawai Eksekutif Keretapi Tanah Melayu Berhad (KTMB), Datuk Kamarulzaman Zainal berkata, kejadian berlaku ketika komuter itu dalam perjalanan dari Stesen Tanjung Malim ke Stesen Sungai Buloh.

"Sebaik tiba di lokasi, komuter itu bergesel dengan ETS yang bergerak dari Stesen Padang Besar menuju ke Stesen KL Sentral.

"Akibatnya, seorang penumpang cedera di tangan dan diberi rawatan kecemasan oleh kakitangan komuter yang berada di lokasi kejadian. Mangsa kemudian meneruskan perjalanan ke Sungai Buloh," katanya dalam kenyataan hari ini.

Mengulas lanjut, Kamarulzaman berkata, penumpang ETS juga dipindahkan menaiki ETS berikutnya untuk meneruskan perjalanan menuju destinasi masing-masing.

Beliau berkata, satu landasan antara Stesen Sungai Buloh dan Stesen Rawang tidak terhalang dan boleh digunakan untuk perkhidmatan tren lain.

Menurutnya, pihaknya kini giat menjalankan kerja baik pulih di lokasi kejadian.

"Siasatan terperinci dimulakan bagi mengenal pasti punca kejadian," katanya.

Katanya, semua agensi berkaitan termasuk Agensi Pengangkutan Awam Darat (APAD) akan dimaklumkan mengenai siasatan itu.

